import React,{Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  constructor(){
    super();
    this.state = {
      string: 'Hello Mishra',
      string2: 'Hello Mishraaa'
    }
  } 


  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
             {this.state.string}

            </p>
            <button onClick = {() => this.setState.string2} >Change Text</button>
        </header>Edit <code>src/App.js</code> and save to reload.

      </div>
    );
  }
}

export default App;
